Explicación: Este soneto es del poeta español Bartolomé Cairasco de Figueroa, un escritor canario del siglo XVI que destaca por su obra poética. El poema es un soneto dedicado a un "pájaro canario", con referencias mitológicas (Helicona) y un claro encomio a la isla de Gran Canaria, lugar de origen del poeta.
